            <EmployeeCard/>
        </Grid>
        <Grid item xs={4}>
            <EmployeeCard/>
        </Grid>
        <Grid item xs={8}>
            <EmployeeCard/>
        </Grid> */}
      </Grid>
    </Box>
    </div>
  );
}

export default Home;
